    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "x = np.arange(-3.14, 3.14, 0.01)\n",
    "y = np.sin(x)\n",
    "\n",
    "plt.stem(x,y)\n",
    "plt.title('Sine wave from -3.14 to 3.14 with Intervals of 0.01')\n",
    "plt.xlabel('x')\n",
    "plt.ylabel('sin(x)')\n",
    "plt.grid(True)\n",
    "plt.axhline(0, color='black', lw=0.5)\n",
    "plt.axvline(0, color='black', lw=0.5)\n",
    "plt.show()"
