    "import numpy as np\n",
    "import matplotlib.pyplot as plt\n",
    "\n",
    "x = np.arange(1, 50, 1)\n",
    "y = np.log(x)\n",
    "\n",
    "plt.stem(x,y)\n",
    "plt.title('Natural Logarithmic function from 1 to 50 with Intervals of 1')\n",
    "plt.xlabel('x')\n",
    "plt.ylabel('log(x)')\n",
    "plt.grid(True)\n",
    "plt.axhline(0, color='black', lw=0.5)\n",
    "plt.axvline(0, color='black', lw=0.5)\n",
